webpackJsonp([30174437671933],{628:function(t,a){t.exports={data:{markdownRemark:{html:'<p>Gatsby CLI工具可让您安装“Starters”。 这些是部分建立的网站预先配置，以帮助您更快地创建一个特定类型的网站。</p>\n<p>创建新网站时，您可以选择指定一个Starter作为新网站的基础，例如</p>\n<p><code>gatsby new [SITE_DIRECTORY] [URL_OF_STARTER_GITHUB_REPO]</code></p>\n<p>例如，要使用Gatsby快速创建博客，可以运行以下命令安装名为Blog的Starter：</p>\n<p><code>通过运行npm install下载文件并初始化站点</code></p>\n<p>这通过运行npm install下载文件并初始化站点</p>\n<p>如果您未指定自定义Starter，则将从<a href="https://github.com/gatsbyjs/gatsby-starter-default">默认Starter</a>创建您的站点。</p>\n<p>有几个Starter已经创建。通过提交PR创建你的！</p>\n<p>官方的：</p>\n<ul>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-default">gatsby-starter-default</a> <a href="http://gatsbyjs.github.io/gatsby-starter-default/">(demo)</a></li>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-blog">gatsby-starter-blog</a> <a href="http://gatsbyjs.github.io/gatsby-starter-blog/">(demo)</a></li>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-hello-world">gatsby-starter-hello-world</a> <a href="https://aberrant-fifth.surge.sh/">(demo)</a></li>\n</ul>\n<p>社区的：</p>\n<ul>\n<li>\n<p><a href="https://github.com/noahg/gatsby-starter-blog-no-styles">gatsby-starter-blog-no-styles</a> <a href="http://capricious-spring.surge.sh/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>和官方的gatsby-starter-blog一样，但是所有样式都被删除了</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/Vagr9K/gatsby-material-starter">gatsby-material-starter</a> <a href="https://vagr9k.github.io/gatsby-material-starter/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>React-MD for Material design</li>\n<li>SASS/SCSS</li>\n<li>Tags</li>\n<li>Categories</li>\n<li>Google Analytics</li>\n<li>Disqus</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>SEO</li>\n<li><a href="https://github.com/Vagr9K/gatsby-material-starter#features">Full list here!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/fabien0102/gatsby-starter">gatsby-typescript-starter</a> <a href="https://fabien0102-gatsby-starter.netlify.com/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Semantic-ui for styling</li>\n<li>TypeScript</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>Jest/Enzyme testing</li>\n<li>Storybook</li>\n<li>Markdown linting</li>\n<li><a href="https://github.com/fabien0102/gatsby-starter#whats-inside">Full list here!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/jaxx2104/gatsby-starter-bootstrap">gatsby-starter-bootstrap</a> <a href="https://jaxx2104.github.io/gatsby-starter-bootstrap/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Bootstrap CSS framework</li>\n<li>Single column layout</li>\n<li>Simple components: SiteNavi, SitePost, SitePage</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/dschau/gatsby-blog-starter-kit">gatsby-blog-starter-kit</a></p>\n<p>特性</p>\n<ul>\n<li>Blog post listing with previews for each blog post</li>\n<li>Navigation between posts with a previous/next post button</li>\n<li>Tags and tag navigation</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/Vagr9K/gatsby-advanced-starter">gatsby-advanced-starter</a> <a href="https://vagr9k.github.io/gatsby-advanced-starter/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Great for learning about advanced features and their implementations</li>\n<li>Does not contain any UI frameworks</li>\n<li>Provides only a skeleton</li>\n<li>Tags</li>\n<li>Categories</li>\n<li>Google Analytics</li>\n<li>Disqus</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>SEO</li>\n<li><a href="https://github.com/Vagr9K/gatsby-advanced-starter#features">Full list here!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/100ideas/glitch-gatsby-starter-blog/">glitch-gatsby-starter-blog</a> (<a href="https://gatsby-starter-blog.glitch.me">demo</a>)</p>\n<p>特性</p>\n<ul>\n<li><a href="https://glitch.com/edit/#!/remix/gatsby-starter-blog">live-edit</a> a temp, anon copy of app</li>\n<li>same code as <a href="https://github.com/gatsbyjs/gatsby-starter-blog">gatsby-starter-blog</a> (mostly)</li>\n<li>free hosting &#x26; web IDE on glitch.com</li>\n<li>HMR working w/ glitch IDE (see <a href="https://github.com/100ideas/glitch-gatsby-starter-blog/blob/5fce8999bd952087ecdc74c9787a0cb3cb884371/README.md#enabling-hmr">note</a>)</li>\n<li>caution:</li>\n<li>app running in <strong>develop</strong> mode</li>\n<li>glitch serves assets over CDN, API unclear</li>\n<li>virtual server container provides <a href="https://glitch.com/faq#restrictions"><strong>128MB</strong> for app</a> (512MB for assets)</li>\n<li>server can’t install certain gatsby plugins (<code>sharp</code>-based; out of mem?)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/alampros/gatsby-starter-grommet">gatsby-starter-grommet</a> <a href="https://alampros.github.io/gatsby-starter-grommet/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Barebones configuration for using the <a href="https://grommet.github.io/">Grommet</a> design system</li>\n<li>Uses SASS (with CSS modules support)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/PrototypeInteractive/gatsby-react-boilerplate">gatsby-starter-basic</a> <a href="https://prototypeinteractive.github.io/gatsby-react-boilerplate/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Basic configuration and folder structure</li>\n<li>Uses postcss and sass (with autoprefixer and pixrem)</li>\n<li>Uses boostrap 4 grid</li>\n<li>Leaves the styling to you</li>\n<li>Uses data from local json files</li>\n<li>Contains Node.js server code for easy, secure, and fast hosting</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/angeloocana/gatsby-starter-default-i18n">gatsby-starter-default-i18n</a> <a href="https://gatsby-starter-default-i18n.netlify.com">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>localization (Multilanguage)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/saschajullmann/gatsby-starter-gatsbythemes">gatsby-starter-gatsbythemes</a> <a href="https://themes.gatsbythemes.com/gatsby-starter/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>CSS-in-JS via <a href="https://github.com/emotion-js/emotion">Emotion</a>.</li>\n<li>Jest and Enzyme for testing.</li>\n<li>Eslint in dev mode with the airbnb config and prettier formatting rules.</li>\n<li>React 16.</li>\n<li>A basic blog, with posts under src/pages/blog. There’s also a script which creates a new Blog entry (post.sh).</li>\n<li>Data per JSON files.</li>\n<li>A few basic components (Navigation, Footer, Layout).</li>\n<li>Layout components make use of <a href="https://github.com/jxnblk/styled-system">Styled-System</a>.</li>\n<li>Google Analytics (you just have to enter your tracking-id).</li>\n<li>Gatsby-Plugin-Offline which includes Service Workers.</li>\n<li><a href="https://github.com/prettier/prettier">Prettier</a> for a uniform codebase.</li>\n<li><a href="https://github.com/necolas/normalize.css/">Normalize</a> css (7.0).</li>\n<li><a href="https://feather.netlify.com/">Feather</a> icons.</li>\n<li>Font styles taken from <a href="http://tachyons.io/">Tachyons</a>.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/AustinGreen/gatsby-starter-netlify-cms">gatsby-starter-netlify-cms</a> <a href="https://gatsby-netlify-cms.netlify.com/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>A simple blog built with Netlify CMS </li>\n<li>Basic directory organization</li>\n<li>Uses <a href="https://bulma.io/">Bulma</a> for styling</li>\n<li>Visit <a href="https://github.com/AustinGreen/gatsby-starter-netlify-cms">the repo</a> to learn how to set up authentication, and begin modeling your content.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/LeKoArts/gatsby-starter-portfolio-emma">gatsby-starter-portfolio-emma</a> <a href="https://embalmer-glues-43220.netlify.com/">(demo)</a></p>\n<p>特性</p>\n<ul>\n<li>Perfect for designers and photographers</li>\n<li>Full-width Photo Grid-Layout (Responsive Images through <a href="https://using-gatsby-image.gatsbyjs.org/">gatsby-image</a>)</li>\n<li>Minimalistic light theme with large images</li>\n<li>Create your projects in Markdown</li>\n<li>Styling with SCSS and <a href="https://kyleamathews.github.io/typography.js/">Typography.js</a></li>\n<li>Easily configurable</li>\n<li>And other good stuff (SEO, Offline Support, WebApp Manifest Support)</li>\n</ul>\n</li>\n</ul>',excerpt:"Gatsby CLI工具可让您安装“Starters”。 这些是部分建立的网站预先配置，以帮助您更快地创建一个特定类型的网站。 创建新网站时，您可以选择指定一个Starter作为新网站的基础，例如 gatsby new [SITE_DIRECTORY] [URL_OF…",timeToRead:5,frontmatter:{title:"Gatsby Starters"},parent:{__typename:"File",relativePath:"docs/gatsby-starters.md"}}},pathContext:{slug:"/docs/gatsby-starters/"}}}});
